import React from "react";
import {BrowserRouter as Router, Link} from 'react-router-dom'
import AuthContext from '../AuthContext'
let LogoSmall = require('../assets/Payroll-Pal-Logo Small.svg');

class Header extends React.Component {
    constructor(props){
        super(props)
        this.logout = this.logout.bind(this)
    }
    logout(){
        this.props.context.logout()
    }
    render(){
        return (
            <div>
                <nav className="navbar navbar-expand-lg">
                    <a className="navbar-brand" href="#"><img src={LogoSmall}/></a>
                    <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div classname="collapse justify-content-end navbar-collapse">
                        <ul className="navbar nav justify-content-end top-nav py-3 fixed-top">
                            <li className="nav-item">
                                <Link className="pt-mono nav-link" to="/core">Approve All</Link>
                            </li>
                            <li className="nav-item mr-auto">
                                <Link to="/login" className="pt-mono nav-link" onClick={this.logout}>Logout</Link>
                            </li>
                        </ul>
                    </div>
                </nav>
            </div>

        )
    }
}

export default (props) => (
    <AuthContext.Consumer>
        {
            (context) => <Header {...props} context={context} />
        }
    </AuthContext.Consumer>
)
